import { BrowserRouter, Routes, Route, Link } from 'react-router-dom';
import Contacts from './contacts';


function About() {
  return <h1>About</h1>;
}

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Contacts />} />
        <Route path="/Contacts/:id" element={<About />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
